import React from "react";
import { Link } from "react-router-dom";

function Navbar() {
  return (
    <nav style={{
      backgroundColor: "#333",
      padding: "10px",
      marginBottom: "20px"
    }}>
      <Link to="/users" style={{ color: "#fff", marginRight: "20px", textDecoration: "none" }}>Kullanıcılar</Link>
      <Link to="/machines" style={{ color: "#fff", marginRight: "20px", textDecoration: "none" }}>Makineler</Link>
      <Link to="/faults" style={{ color: "#fff", textDecoration: "none" }}>Arızalar</Link>
    </nav>
  );
}

export default Navbar;
